import React from 'react';
import '../styles/home.css';
import { Link } from 'react-router-dom';
import getMusics from '../services/API_MUSICS';

class SobreMim extends React.Component{
    render() {
        console.log(getMusics());
        return (
            <section className='graduateSection'>
                <Link to='/SobreMim'>
                <img src='' className='gabriela' alt=''/>
            </Link>
            <nav>Navegação</nav>
            <section>
                Favorites Songs
                <audio data-testid="audio-component" src="https://audio-ssl.itunes.apple.com/itunes-assets/AudioPreview115/v4/a7/1b/f0/a71bf07d-f498-05c9-2c8a-d12af7d019d8/mzaf_11402952498213508559.plus.aac.p.m4a" controls>
            <track kind="captions" />
            O seu navegador não suporta o elemento
            <code>audio</code>
          </audio>
            </section>
            <footer>Footer</footer>
            </section>
        )
    }
}

export default SobreMim;
